// Imports
import React from 'react'
import PropTypes from 'prop-types'
import Button from 'shared/button'

const Upload = ({
  loading,
  makeInvoice,
  disabled,
  makeInvoiceAndSend,
  makePreviewInvoice
}) => (
  <div>
    <hr />
    <Button
      buttonStyle='primary'
      loading={loading}
      onClick={makeInvoice}
      icon='telegram'
      disabled={disabled || loading}
    >
      Generar Factura
    </Button>
    {makeInvoiceAndSend && (
      <Button
        buttonStyle='secondary'
        loading={loading}
        onClick={makeInvoiceAndSend}
        icon='email'
        disabled={disabled || loading}
      >
        Generar Factura y enviar
      </Button>
    )}
    {makePreviewInvoice && (
      <Button
        buttonStyle='secondary'
        loading={loading}
        onClick={makePreviewInvoice}
        icon='file-find'
        disabled={loading}
      >
        Generar Vista Previa Factura
      </Button>
    )}
  </div>
)

Upload.propTypes = {
  loading: PropTypes.bool,
  makeInvoice: PropTypes.func,
  disabled: PropTypes.bool
}
export default Upload
